import logo from './logo.svg';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Typography variant="h4">Katz Electronic Conversion App</Typography>
        <Typography sx={{pt:'10px', pt:'10px',}}variant="body1">Upload the KatzLaw Aderant export file (.TAB file)</Typography>
        <Button variant="contained" size="large">Upload File</Button>
      </header>
    </div>
  );
}

export default App;
